import React from "react";
import "./styles.css";

export default function App() {
  return Article();
}

function Article() {
  return (<article className="article">
<h2 className="article__title">Life aaah finds a Way</h2>
<label for="react" id="react">React to Jurassicpark</label>
<input type="text" id="react"></input>
<a href="Jurassicpark.com" className="article__link">Jurassicpark</a>
  </article>);
}
